	const [url, setUrl] = useState("https://pokedex-jgabriele.vercel.app/pokemons.json");
    const { data, isPending, error } = useFetch(url);

	return (
		<>
			<NavBar></NavBar>
			<SearchBar></SearchBar>
		</>
	);
}

export default App;
